window.onload=()=>{(async()=>{const e=await fetch("/getRoomData",{method:"GET",headers:{"Content-Type":"application/json"}}),n=await e.json();if(!n)return;const r=document.querySelector("#roomName"),a=document.querySelector("#roomTheme"),o=document.querySelector("#roomMembers");switch(r.innerHTML=`Name: ${n.name}`,a.innerHTML="Theme: ",n.theme){case"default":a.innerHTML+="Default";break;case"coffee":a.innerHTML+="Coffee Shop";break;case"western":a.innerHTML+="Western";break;case"cyberpunk":a.innerHTML+="Cyberpunk";break;case"kawaii":a.innerHTML+="Kawaii";break;default:a.innerHTML+="Undefined"}o.innerHTML=`Amount of Members: ${n.amtMembers}`})()};